import React from "react";
import { links, btn, btnGreen } from "./utils";

export const Navbar = () => {
  return (
    <header className="flex py-4">
      <div className="flex-1">
        <h2 className="text-green-300 text-5xl text-center">MovieDB</h2>
      </div>
      <nav className="flex-1">
        <ul className="flex justify-center h-full items-center">
          {links.map((link, index) => {
            const { text, url } = link;
            return (
              <li id={index} className="hover:underline text-lg">
                <a href={url} className="px-4">
                  {text}
                </a>
              </li>
            );
          })}

          {/* <li className="px-4">
            <a href="/#" className="hover:underline">
              Movie
            </a>
          </li>
          <li className="px-4">
            <a href="/#">TV</a>
          </li>
          <li className="px-4">
            <a href="/#">Actors</a>
          </li>
          <li className="px-4">
            <a href="/#">More</a>
          </li> */}
        </ul>
      </nav>
      <div className="flex-1 flex justify-center items-center">
        <button className={`${btn} ${btnGreen}`}>Login</button>
      </div>
    </header>
  );
};

export default Navbar;
